import React from 'react'
function Article(props) {
    const {article} = props
    const body = <section>{article.title}</section>
    return (
        <div>
            <h2>title</h2>
            {body}
            <h3>
                creation data:{(new Date). toDateString()}
            </h3>
        </div>
    )
}

export default Article
